  false,\n\t\"url\": null,\n\t\"notes\": \"Arapaho National Wildlife Refuge (Refuge)
  and the Owl Mountain Partnership (OMP) are implementing a 5-year riparian/meadow
  management demonstration project. The cooperators feel there is not enough information
  readily available concerning \"managed\" riparian areas for the compatibility of
  livestock, fisheries and wildlife and the plant community as a whole. Characteristics
  of a healthy, managed riparian area include stable, well vegetated banks, a deep
  stream channel, a high water table, good water retention, and good water quality.
  These five characteristics may in tum lead to species diversity and richness while
  at the same time, sustain livestock production capabilities. This report provides
  the objectives, treatments, and monitoring of the project area(s).\",\n\t\"owner_org\":
